      prior amendment for general notes for this reporting period.  In response to
      FEC RFAI dated 3/18/09:   We have correctly reported the transfer from the North
      Dakota Democratic-Nonpartisan League Party.    A $25,000 contribution from Obama
      for America was misdeposited by our bank into a non-federal account of the NCDP.  The
      intended account for the deposit was the NCDP-CFC Federal account.  The NCDP
      CFC-Federal account was made whole by an internal transfer from another federal
      account of the NCDP.  The sources of funds in the federal account comprising
      the funds used for the transfer have been identified in previous reports of
      receipts and disbursements disclosed to the FEC.  The accounting data has been
      corrected to indicate the internal transfer.    The amendment filed on 1/30/09
      included $92,625.43 in in-kind contributions not reported on the original report.  At
      the time the original report was filed, we did not have the records required
      to include the in-kind contributions.  The 1/30/09 amendment including the in-kind
      contributions was filed as soon as the complete information was obtained and
      verified.    All in-kind contributions exceeding the $200 aggregate threshold
      were itemized on Schedule B on the original amendment filed on 1/30/09.  Per
      our discussion with the FEC, in-kind contributions not exceeding the $200 aggregate
      threshold are not required to be itemized.    All disbursements noted as Exempt
      met FEC requirements, including any volunteer component required, and no funds
      transferred-in from a national party committee were used to pay for Exempt activities.  All
      disbursements noted as Exempt were made with funds from accounts that were segregated
      from other accounts containing funds transferred-in from a national party committee.

